B.Fk=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.s)
