B.GY=A.a(s(["Frei bewegliche Teilchen f\xfchren bei Temperaturen T>0K thermische Bewegungen aus, deren Betrag und Richtung statistisch verteilt sind.","Betrachtet man zun\xe4chst nur die linke Kammer, so ist in dieser die Teilchenkonzentration \xfcberall konstant. Im Mittel heben sich demnach die thermischen Bewegungen der Teilchen gegenseitig auf.","Wird die Trennung zwischen den Kammern entfernt, so entsteht an dieser Stelle ein sehr gro\xdfer Konzentrationsgradient dn/dx. In diesem Bereich heben sich die thermischen Bewegungen nicht mehr gegenseitig auf und es kommt zu einem Zerflie\xdfen des Teilchenhaufens, so lange, bis die Teilchenkonzentration wieder \xfcberall konstant ist.","Dieser Diffusionsvorgang durch thermische Bewegung ist unabh\xe4ngig von der Ladung der Teilchen. Handelt es sich jedoch um freie Elektronen oder L\xf6cher, so f\xfchrt die Diffusionsbewegung zu einem Diffusionsstrom. Dieser ist proportional dem Gradienten der Ladungstr\xe4gerverteilung dn/dx und der Temperatur T."]),t.s)
B.xP=new A.cd("Dieses Applet veranschaulicht den Vorgang der Diffusion.\n\nMan sieht:\n",B.GY,null)
B.GE=A.a(s(["Da allein die Null- und Polstellen der \xdcbertragungsfunktion die \xdcbertragungseigenschaften der Schaltung festlegen, gen\xfcgt es, deren Lage in der komplexen Ebene anzugeben, was durch Kreuze (x) f\xfcr Pole und Kreise (o) f\xfcr Nullstellen erfolgt. Die in diesem Beispiel gezeigte Schaltung weist also zwei Polstellen p1 und p2 und keine Nullstellen auf.","Durch \xc4nderung des Schaltungsparameters v \xe4ndert sich unmittelbar die \xdcbertragungsfunktion und damit auch die Lage der Polstellen in der komplexen Ebene wie im Bild oben links dargestellt.","Die Polstellenverteilung hat wiederum Einfluss auf den Frequenzgang |A(jw)| sowie den Phasengang phase(A(jw)) der Schaltung (Bild rechts oben bzw. unten).","Ebenso besteht ein wichtiger Zusammenhang zwischen der Lage der Polstellen und dem dynamischen Verhalten der Schaltung. Da jeder Pol s' der \xdcbertragungsfunktion A(s) einen Term der Form 1-exp(s' t) in der Sprungantwort liefert (Laplace-Transformation), bedeutet ein reeller Pol in der linken Halbebene der komplexen Frequenzebene (v<1) einen aperiodischen Anstieg der Sprungantwort auf deren Endwert (hier: v). Ein konjugiert komplexes Polpaar in der linken Halbebene (1<v<3) verursacht wegen der komplexen Exponentialfunktion einen periodischen Einschwingvorgang und f\xfcr ein rein komplexes Polpaar (v=3) ergibt sich schlie\xdflich eine unged\xe4mpfte Sinusschwingung.","Je n\xe4her die Pole der \xdcbertragungsfunktion in Richtung der imagin\xe4ren Achse wandern, um so eher neigt die Schaltung zum Schwingen. Dies zeigt sich au\xdfer in der Sprungantwort auch in dem Frequenzgang |A(jw)|, der bei der Schwingfrequenz eine ausgepr\xe4gte \xdcberh\xf6hung zeigt. Besonders kritisch ist Situation bei gegengekoppelten Verst\xe4rkerschaltungen, bei denen man der Stabilit\xe4t besonderes Augenmerk widmen muss."]),t.s)
B.xQ=new A.cd("Dieses Applet zeigt f\xfcr eine konkrete Schaltung mit der \xdcbertragungsfunktion A(jw)=ua/ue beispielhaft den Einfluss eines der Schaltungsparameter auf die Lage der Polstellen und damit auf den Frequenzgang. Ebenso ist der Einfluss der Lage der Pole auf den Phasengang und auf die Sprungantwort dargestellt.\n\nMan sieht:\n",B.GE,null)
B.GR=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.s)
B.xR=new A.cd("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.GR,null)
B.Gb=A.a(s(["Der Bipolartransistor besteht aus drei unterschiedlich dotierten Gebieten (Emitter, Basis und Kollektor). Im Fall des npn-Transistors sind der Emitter (E) und der Kollektor (C) n-dotiert, die Basis (B) ist p-dotiert, so dass man zwei hintereinandergeschaltete pn-\xdcberg\xe4nge erh\xe4lt."]),t.s)
B.xS=new A.Eo(null)
B.Hc=A.a(s(["Da im thermodynamischen Gleichgewicht die Fermienergie Wf (hier nicht dargestellt) im Bauelement \xfcberall auf dem gleichen Niveau liegt, ist die relative Lage der Valenz- und Leitungsbandkanten in den einzelnen Gebieten von den dortigen Dotierungen abh\xe4ngig (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm). In den n-dotierten Source- und Draingebieten liegen die Bandkanten Wc und Wv demnach unterhalb denen im p-dotierten Bulk und es ergeben sich die im Diagramm dargestellten Potenzialverl\xe4ufe.","Damit Elektronen von der Source zur Drain wandern k\xf6nnen, m\xfcssen diese erst die unterhalb des Gates liegende Potenzialbarriere \xfcberwinden. Die H\xf6he der Barriere h\xe4ngt dabei insbesondere von den am Transistor anliegenden Spannungen ab:",'Durch Anlegen einer positiven Gatespannung (UGS>0) gegen\xfcber dem Bezugspotenzial (Source) verschiebt sich das Ferminiveau an der Gate-Elektrode nach unten und die Bandkanten Wc und Wv im Bulk unmittelbar unterhalb des Gate "verbiegen" sich (vgl.: B\xe4nderdiagramm einer MOS-Struktur). Dadurch verringert sich die Potenzialbarriere.',"Durch Anlegen einer negativen Bulkspannung (USB>0) gegen\xfcber dem Bezugspotenzial (Source) verschieben sich das dortige Ferminiveau und damit die Bandkanten Wc und Wv im Bereich des Bulk nach oben und die Potentialbarriere erh\xf6ht sich.","Ob ein Strom durch den Transistor flie\xdfen kann oder nicht, h\xe4ngt somit von der Lage der Bandkanten unmittelbar unterhalb des Gates (im Bereich des Kanals) ab. In den nachfolgenden Applets ist daher lediglich der Verlauf der Bandkanten entlang der y-Achse bei x=0 dargestellt."]),t.s)
B.xT=new A.cd("Das Applet zeigt den Verlauf des B\xe4nderdiagramms eines MOSFET \xfcber dem Querschnitt des Bauelementes. Es wird der Einfluss von Gate- und Substratspannung auf den Verlauf der Bandkanten Wc und Wv schematisch dargestellt. In dem Applet liegt der Source-Anschluss auf 0V (Bezugspotenzial).\n\nMan sieht:\n",B.Hc,null)
B.He=A.a(s(["Im Bode-Diagramm ist der typische Frequenzgang |a(jw)| und der Phasengang Phase[a(jw)] eines nicht r\xfcckgekoppelten Verst\xe4rkers a mit abnehmender Verst\xe4rkung f\xfcr hohe Frequenzen dargestellt, wie er sich z.B. f\xfcr einen Operationsverst\xe4rker ergibt.","Zus\xe4tzlich ist in das Diagramm der Kehrwert 1/k des - hier frequenzunabh\xe4ngigen - R\xfcckkopplungsfaktors eingetragen, was einem R\xfcckkopplungsnetzwerk mit ohmschen Widerst\xe4nden entspricht.","F\xfcr die Gesamtverst\xe4rkung des r\xfcckgekoppelten Systems gilt A = a/(1+ak). Da f\xfcr gro\xdfe Werte von a n\xe4herungsweise A=1/k gilt, kann man A direkt aus dem Diagramm ablesen. F\xfcr gr\xf6\xdfer werdendes k, d.h. st\xe4rkere R\xfcckkopplung, sieht man deutlich die Abnahme der Gesamtverst\xe4rkung.","Die f\xfcr die Stabilit\xe4t wichtige Schleifenverst\xe4rkung a*k ergibt sich in der logarithmischen Darstellung wegen a*k=a/(1/k) aus dem Abstand der Kurve a zur Kurve 1/k und kann ebenfalls direkt abgelesen werden.","Insbesondere ist am Schnittpunkt der Kurven a und 1/k der Betrag |a*k| der Schleifenverst\xe4rkung gleich 1 (=0dB). Ist nun bei dieser Frequenz wd die Phase gleichzeitig 180 Grad, so ist a*k = -1, d.h. der Verst\xe4rker ist instabil und schwingt.","F\xfcr kleine R\xfcckkopplungsfaktoren k ist bei der Frequenz wd die Phase sehr weit von dem kritischen Wert 180 Grad entfernt, der Verst\xe4rker ist stabil.","F\xfcr zunehmendes k, d.h. st\xe4rkere R\xfcckkopplung, r\xfcckt die Phase bei der Frequenz wd, wo der Betrag der Schleifenverst\xe4rkung gleich 1 ist, immer n\xe4her an 180 Grad, der Verst\xe4rker wird instabil und schwingt.","Um Stabilit\xe4t des r\xfcckgekoppelten Verst\xe4rkers f\xfcr beliebiges k zu gew\xe4hrleisten, greift man zur so genannten Kompensation. Dabei wird der Frequenz- und Phasengang des nicht r\xfcckgekoppelten Verst\xe4rkers durch schaltungstechnische Ma\xdfnahmen so ge\xe4ndert, dass die Phase an der Stelle wd f\xfcr beliebige k 180 Grad nicht erreicht."]),t.s)
B.xU=new A.cd("Dieses Applet zeigt den Zusammenhang zwischen der Schleifenverst\xe4rkung eines gegengekoppelten Verst\xe4rkers und dessen Stabilit\xe4t.\n\nMan sieht:\n",B.He,null)
B.Hi=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.s)
B.xV=new A.cd(u.k,B.Hi,null)
B.Hd=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.s)
B.xW=new A.Ep(null)
B.H5=A.a(s(["Je nach Typ (n oder p) sind freie Elektronen oder L\xf6cher in einem Halbleiter vorhanden.","Legt man eine Spannung U an die Struktur, so bewirkt dies ein elektrisches Feld E im Halbleiter.","Unter Einfluss des elektrisches Feldes E bewegen sich die freien Ladungstr\xe4ger in dem Halbleiter, was zu einem elektrischen Strom I f\xfchrt.","Je gr\xf6\xdfer die Spannung ist, desto so gr\xf6\xdfer ist das elektrische Feld und damit die Geschwindigkeit der Ladungstr\xe4ger, was eine Zunahme des Stromes bedeutet. Der Zusammenhang zwischen elektrischem Feld und der Ladungstr\xe4gergeschwindigkeit ist die so genannte Beweglichkeit."]),t.s)
B.xX=new A.cd("Dieses Applet verdeutlicht den Einfluss eines elektrischen Feldes auf freie Ladungstr\xe4ger in einem Halbleiter.\n",B.H5,null)
B.FS=A.a(s(["Aus der \xdcbertragungskennlinie des Verst\xe4rkers erkennt man, dass ein Eingangssignal UBE nur im mittleren Bereich der Kennlinie verst\xe4rkt wird, in dem die Steigung dUCE/dUBE gro\xdf ist.","Um ein sinusf\xf6rmiges Eingangssignal mit der Amplitude ube verzerrungsfrei zu verst\xe4rken, muss diesem demnach ein Gleichanteil UBE0 \xfcberlagert werden, so dass das Eingangssignal stets im mittleren Bereich der Kennlinie verl\xe4uft. Der Gleichanteil UBE0 legt dabei den so genannten Arbeitspunkt der Verst\xe4rkerschaltung fest.","Liegt der Arbeitspunkt in der Mitte der Kennlinie, kann die Amplitude ube des Eingangssignals sehr gro\xdf gew\xe4hlt werden, ohne dass Begrenzungseffekte und damit Verzerrungen auftreten. Diese Betriebsart nennt man A-Betrieb.","Liegt der Arbeitspunkt auf dem Wert UBE0=0V, so spricht man vom B-Betrieb. Bei dieser Betriebsart wird die untere Halbwelle des Eingangssignals vollst\xe4ndig und die obere zum Teil abgeschnitten, das Signal also stark verzerrt.","Beim so genannten AB-Betrieb liegt der Arbeitspunkt UBE0 etwa im Knickpunkt der Kennlinie bei relativ kleinen Spannungen UBE0. Die untere Halbwelle des Eingangssignals wird zwar abgeschnitten, die obere Halbwelle des Eingangssignals wird jedoch bis hin zu sehr gro\xdfen Amplituden verzerrungsfrei \xfcbertragen.","Der C-Betrieb ist durch eine negative Vorspannung UBE0<0 gekennzeichnet. Diese Betriebsart wird z.B. bei Sender\xf6hren angewandt."]),t.s)
B.xY=new A.cd(u.f,B.FS,null)
B.Fi=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.s)
B.xZ=new A.cd("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit Bipolartransistor.\n\nMan sieht:\n",B.Fi,null)
B.H6=A.a(s(["Ersetzt man die imagin\xe4re Variable jw der \xdcbertragungsfunktion A(jw) formal durch die komplexe Gr\xf6\xdfe s=r+jw, so erh\xe4lt man eine Funktion A(s), die nun z.B. dem Betrag nach in der komplexen r-w Ebene dargestellt werden kann (unteres Bild). Man spricht in diesem Fall von analytischer Fortsetzbarkeit, da die urspr\xfcngliche Funktion mit imagin\xe4rem Argument ins Komplexe fortgesetzt wird. Dies ist auf Grund der Holomorphie rationaler Funktionen m\xf6glich.","Der Verlauf der Funktion |A(s)| in der komplexen Ebene ist durch die Lage der Null- und Polstellen eindeutig definiert. Insbesondere ist durch die Lage der Null- und Polstellen auch der Verlauf von |A(s)| f\xfcr r=0, d.h. entlang der Frequenzachse, festgelegt. Dies entspricht aber gerade dem Frequenzgang |A(jw)|, der f\xfcr positive Frequenzen, d.h. jw>0, im oberen Bild zur Verdeutlichung nochmals im logarithmischen Ma\xdfstab dargestellt ist.","Der Einfluss der Lage der Pole auf den Frequenzgang |A(jw)| wird deutlich, wenn in dem Beispiel der Parameter a und damit die Lage der Pole ge\xe4ndert wird. Verschieben sich diese z.B. f\xfcr kleiner werdendes a in Richtung der Frequenzachse (jw), so tritt im Frequenzgang eine deutliche \xdcberh\xf6hung auf. F\xfcr den Schaltungsentwickler interessant ist nun die Frage, welchen Einfluss Schaltungsparameter auf die Lage der Pole und damit auf den Frequenzgang der Schaltung haben."]),t.s)
B.y_=new A.cd("Diese Applet beschreibt den Zusammenhang zwischen der Null-/Polstellenverteilung einer \xdcbertragungsfunktion A(jw) in der komplexen Frequenzebene und dem Verlauf des Frequenzganges am Beispiel der Funktion:\n        [Formel]\n        mit drei Polstellen und dem ver\xe4nderlichen Parameter a.\nMan sieht: \n        ",B.H6,null)
B.FT=A.a(s(["F\xfcr die gezeigte Anordnung eines gegengekoppelten Verst\xe4rkers, bei dem ein Teil k des Ausgangssignals wieder mit umgekehrtem Vorzeichen auf den Eingang zur\xfcckgef\xfchrt wird, ergibt sich allgemein eine Gesamtverst\xe4rkung ua/ue von:"]),t.s)
B.y0=new A.Eq(null)
B.EV=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten xB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite xB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite xB ist."]),t.s)
B.y1=new A.cd("Dieses Applet veranschaulicht die Ladungstr\xe4gerverteilung eines Bipolartransistors im Normalbetrieb f\xfcr unterschiedliche Basisweiten.\n\nMan sieht:\n",B.EV,null)
B.F0=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.s)
B.jv=new A.cd(u.k,B.F0,null)
B.ED=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.s)
B.y2=new A.cd("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.ED,null)
B.H9=A.a(s(["Ausgangspunkt der \xdcberlegungen ist das vereinfachte Ersatzschaltbild des zu kompensierenden Verst\xe4rkers mit den parasit\xe4ren Kapazit\xe4ten, welche die Polstellen der \xdcbertragungsfunktion a(jw) und damit den Frequenz- und Phasengang bestimmen. F\xfcr den zu untersuchenden kritischen Fall gr\xf6\xdftm\xf6glicher R\xfcckkopplung, d.h. k=1 bzw. 1/k=0dB, entspricht die Kurve |a(jw)| gleichzeitig der f\xfcr die Stabilit\xe4t wichtigen Schleifenverst\xe4rkung |a*k|. Die Frequenz wd, bei der der Betrag der Schleifenverst\xe4rkung gleich 1 ist, ergibt sich demnach aus dem Schnittpunkt der Kurve |a(jw)| mit der Frequenzachse.","F\xfcr den nicht kompensierten Verst\xe4rker sieht man, dass bei dieser Frequenz die Phase 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.","Eine M\xf6glichkeit, den Verst\xe4rker zu stabilisieren, ist nun, die Kapazit\xe4t C1 zu vergr\xf6\xdfern. Dadurch verschiebt sich der Pol w1 der \xdcbertragungsfunktion, womit eine \xc4nderung des Frequenz- und des Phasengangs einhergeht. Insbesondere erreicht man jedoch, dass durch den jetzt fr\xfcher einsetzenden Verst\xe4rkungsabfall die Frequenz wd zu niedrigeren Werten hin verschoben wird, bei denen die Phasendrehung noch keine 180 Grad betr\xe4gt. Der Verst\xe4rker bleibt somit stabil.","Nachteilig ist jedoch, dass zur Kompensation sehr gro\xdfe Kapazit\xe4tswerte im nF-Bereich n\xf6tig sind, was f\xfcr integrierte Operationsverst\xe4rker nicht akzeptabel ist. Eine bessere Methode zur Kompensation ist daher die so genannte Miller-Kompensation."]),t.s)
B.y3=new A.Er(null)
B.H8=A.a(s(["Bei dieser Art der Kompensation wird die Kompensationskapazit\xe4t Ck nicht parallel zu C1, sondern zwischen die beiden Verst\xe4rkerstufen eingef\xfcgt.","F\xfcr den nicht kompensierten Verst\xe4rker, d.h. Ck=0, sieht man, dass f\xfcr sehr hohe Frequenzen die Phasenverschiebung 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.",'Durch Vergr\xf6\xdferung von Ck werden nun, da die beiden Verst\xe4rkerstufen nicht mehr unabh\xe4ngig voneinander sind, beide Pole beeinflusst. Insbesondere wandert der Pol p1 zu niedrigeren Frequenzen, wie es auch bereits bei der Kompensation durch Polverschiebung der Fall war. Zus\xe4tzlich verschiebt sich aber auch der Pol p2 zu h\xf6heren Frequenzen, so dass beide Pole weiter auseinanderstreben ("pole splitting") und damit der kritische Wert der Phasendrehung von 180 Grad erst bei h\xf6heren Frequenzen erreicht wird.',"Wichtigster Vorteil ist jedoch, dass bereits sehr kleine Werte von Ck ausreichen, um den Pol p1 zu verschieben. Der Grund daf\xfcr liegt darin, dass Ck zwischen beiden Verst\xe4rkerstufen liegt, und damit bereits kleine Spannungs\xe4nderungen an der Eingangsstufe gro\xdfe Spannungs\xe4nderungen \xfcber der Kapazit\xe4t bewirken. Diese wirkt dadurch wie eine um den Faktor der Spannungsverst\xe4rkung vergr\xf6\xdferte Kapazit\xe4t, die parallel zu C1 liegt (Miller-Effekt)."]),t.s)
B.y4=new A.Es(null)
B.Fw=A.a(s(["Liegt keine \xe4u\xdfere Spannung \xfcber der Struktur (U=0V), ist der pn-\xdcbergang im thermodynamischen Gleichgewicht (TGG). In der gezeigten B\xe4nderdiagrammdarstellung liegt das Ferminiveau Wf im TGG \xfcberall auf gleicher H\xf6he. In diesem Fall liegen auch die Pegel der Elektronen im p- und im n-Gebiet auf gleicher H\xf6he, so dass keine Netto-Ausgleichsbewegung, d.h. Bewegung von Elektronen von einem Gebiet in das andere, erfolgt. Entsprechendes gilt f\xfcr die L\xf6cher, deren Pegel ebenfalls auf gleichem Niveau liegen.","Durch das Anlegen einer \xe4u\xdferen elektrischen Spannung U>0V an die Struktur verschieben sich die Bandkanten gem\xe4\xdf U=-W/q, wobei in der Darstellung der Anschaulichkeit halber der ohmsche Spannungsabfall im Halbleitermaterial (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm) vernachl\xe4ssigt ist. Der Pegel der Elektronen im n-Gebiet liegt in diesem Fall \xfcber dem der Elektronen in p-Gebiet, so dass Elektronen durch die Raumladungszone in das p-Gebiet wandern. Diese \xfcbersch\xfcssigen Elektronen f\xfchren zu einer lokalen St\xf6rung des TGG, und damit einer Zunahme der Rekombination (G<R) der \xfcbersch\xfcssigen Elektronen mit L\xf6chern, die st\xe4ndig aus dem p-Gebiet nachgeliefert werden, was einem Stromfluss entspricht. Entsprechende \xdcberlegungen gelten f\xfcr die L\xf6cher, deren Pegel im p-Gebiet unter dem im n-Gebiet liegt.","Bei einer Spannung U<0V verschieben sich die B\xe4nder in umgekehrte Richtung, so dass nun Minorit\xe4tstr\xe4ger \xfcber die Raumladungszone in das benachbarte Gebiet gelangen k\xf6nnen. Wegen der sehr geringen Tr\xe4gerdichte der Minorit\xe4tstr\xe4ger wandern jedoch nur sehr wenige Ladungstr\xe4ger durch die Raumladungszone, was einem sehr kleinen Strom entspricht, der auch mit zunehmender Sperrspannung nicht wesentlich ansteigt."]),t.s)
B.y5=new A.cd("Dieses Applet zeigt f\xfcr einen pn-\xdcbergang die Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.Fw,null)
B.Fh=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T3 und T4 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T2.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes durch die beiden Transistoren T2 und T4 sowie den Wert der Ausgangsspannung Ua. Die Ausgangsspannung im Arbeitspunkt kann bei der Schaltung z.B. auf den Wert Ua,A = 0V eingestellt werden.","Wegen des flachen Verlaufs der Kennlinien haben bereits kleine \xc4nderungen der Eingangsspannung Ue gro\xdfe Auswirkungen auf die Lage des Schnittpunktes der beiden Kurven und damit auf die Spannung Ua am Ausgang der Schaltung. Die Verst\xe4rkung dieser Schaltung f\xfcr Differenzeingangssignale ist daher sehr gro\xdf.","Da die Verst\xe4rkung um so gr\xf6\xdfer ist, je flacher die Steigung der Kennlinien ist, steigt die Verst\xe4rkung mit zunehmendem Ausgangswiderstand r0, d.h. mit abnehmendem Kanall\xe4ngenmodulationsfaktor Lambda der Transistoren."]),t.s)
B.y6=new A.cd("Dieses Applet veranschaulicht die Funktion des Differenzverst\xe4rkers mit Stromspiegel bei Ansteuerung mit Differenzsignalen.\nMan sieht:\n",B.Fh,null)
B.F1=A.a(s(["Wie bei der einfachen Bipolar-Verst\xe4rkerschaltung mit ohmscher Last kann die \xdcbertragungskennlinie auch f\xfcr aktive Lastelemente grafisch konstruiert werden, indem das Ausgangskennlinienfeld IDS=IDS(UDS,UGS) des Transistors und die entsprechende Kennlinie IDS(UDS) des Lastelementes in ein Diagramm eingetragen werden. Die Schnittpunkte der Kurven ergeben dann f\xfcr gegebene Werte der Eingangsspannung UGS die dazugeh\xf6rigen Werte der Ausgangsspannung UDS.","Abh\xe4ngig von dem Lastelement (Widerstand, Anreicherungs-, oder Verarmungstransistor) ergeben sich unterschiedliche \xdcbertragungskennlinien des Inverters. Die Kleinsignalspannungsverst\xe4rkung, die der Steigung dUDS/dUGS der \xdcbertragungskennlinie entspricht, h\xe4ngt stark von der Form der Lastkennlinie ab. Sie wird um so gr\xf6\xdfer, je flacher die Lastkennlinie verl\xe4uft, d.h. je gr\xf6\xdfer der differentielle Widerstand r=dUDS/dIDS des Lastelementes ist. In analogen Verst\xe4rkerschaltungen werden daher statt Widerst\xe4nden als Lastelement oft aktive Lasten eingesetzt."]),t.s)
B.y7=new A.Et(null)
B.G8=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.s)
B.y8=new A.cd("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.G8,null)
B.GA=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.s)
B.y9=new A.cd("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.GA,null)
B.G4=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern des Bauelementes generiert, die zum Ladungstransport beitragen k\xf6nnen.","Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger, was wiederum eine Erh\xf6hung der Leitf\xe4higkeit bewirkt. Entsprechend sinkt die Leitf\xe4higkeit bei Verringerung der Bestrahlungsst\xe4rke.","Um die durch die Bestrahlung generierten Ladungstr\xe4ger im Innern des Bauelementes zu trennen und zu den Elektroden hin zu transportieren, ist ein elektrisches Feld E bzw. eine von au\xdfen angelegte Spannung U erforderlich.","Je h\xf6her diese Spannung U ist, desto gr\xf6\xdfer ist der Strom I durch den Fotowiderstand.","Der Strom I ist somit in guter N\xe4herung sowohl zu der Bestrahlungsst\xe4rke Ee als auch zu der angelegten Spannung U proportional, was zu der im Applet rechts gezeigten Widerstandsgeraden f\xfchrt, deren Steigung mit steigender Bestrahlungsst\xe4rke zunimmt.","Ohne Bestrahlung (Ee = 0) weist der Fotowiderstand eine von null verschiedene, geringe Leitf\xe4higkeit auf, d.h. bei einer angelegten Spannung flie\xdft ein geringer Dunkelstrom (der jedoch im linken Teil des Applets nicht animiert ist)."]),t.s)
B.ya=new A.cd("Dieses Applet veranschaulicht die Funktion eines Fotowiderstandes. Die linke Seite des Applets zeigt eine schematische Darstellung des Fotowiderstandes, wobei aus Gr\xfcnden der \xdcbersichtlichkeit nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert werden. Die rechte Seite des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\nMan sieht:\n",B.G4,null)
B.G5=A.a(s(["Wird von au\xdfen eine elektrische Spannung Upn>0 an die Diode angelegt, so verringert sich die effektive, \xfcber dem pn-\xdcbergang liegende Spannung und damit auch das elektrische Feld E. Als Folge davon \xfcberwiegt nun die Diffusionsbewegung; Elektronen werden verst\xe4rkt ins p-Gebiet und L\xf6cher verst\xe4rkt in das n-Gebiet injiziert. Wegen der Neutralit\xe4t au\xdferhalb der RLZ m\xfcssen im gleichen Ma\xdfe die Majorit\xe4tstr\xe4gerdichten (L\xf6cher im p-Halbleiter, Elektronen im n-Halbleiter) ansteigen, so dass beide Ladungstr\xe4gerarten au\xdferhalb der RLZ oberhalb ihrer Gleichgewichtsdichten liegen. Dies f\xfchrt zur Rekombination der Ladungstr\xe4ger. So rekombinieren z.B. die in das p-Gebiet injizierten Elektronen mit den dort befindlichen L\xf6chern. Es m\xfcssen daher st\xe4ndig Majorit\xe4tstr\xe4ger aus den neutralen Gebieten nachgeliefert werden, was einem elektrischen Strom entspricht. Der Strom ist um so gr\xf6\xdfer, je mehr Ladungstr\xe4ger in die neutralen Gebiete injiziert werden, d.h. je h\xf6her die Konzentration der Ladungstr\xe4ger an den R\xe4ndern Xp und Xn der RLZ ist. Diese Konzentration h\xe4ngt exponentiell von der Spannung am pn-\xdcbergang und damit von der von au\xdfen angelegten Spannung Upn ab. Der Strom I durch die Diode steigt daher exponentiell mit der Spannung Upn, was sich in der steil ansteigenden I-U-Kennlinie f\xfcr U>0 zeigt.","F\xfcr Spannungen Upn < 0 wird die effektive Spannung und damit die Feldst\xe4rke E am pn-\xdcbergang erh\xf6ht. Dadurch \xfcberwiegt nun die Driftbewegung gegen\xfcber dem Diffusionsvorgang und die Ladungstr\xe4gerdichten an den Stellen Xn und Xp sinken auf sehr kleine Werte ab. Es gelangen somit auch nur noch sehr wenige Ladungstr\xe4ger durch die RLZ in das jeweils benachbarte Gebiet. Diese wenigen Ladungstr\xe4ger liefern den so genannten Sperrstrom, der sehr klein ist und der auch f\xfcr gro\xdfe negative Spannungen kaum noch w\xe4chst. Die I-U-Kennlinie zeigt daher f\xfcr negative Spannungen kaum noch eine \xc4nderung des Stromes I.","Da sich mit der von au\xdfen angelegten Spannung Upn auch die Spannung am pn-\xdcbergang - d.h. \xfcber der RLZ - \xe4ndert, ver\xe4ndert sich damit auch die Weite der gesamten Raumladungszone. Insbesondere w\xe4chst diese, wenn die Sperrspannung Upn < 0 weiter zu negativen Werten hin erh\xf6ht wird. Die Spannung \xfcber der RLZ - die der Fl\xe4che unter dem Dreieck E(X) entspricht - ist dabei gleich der Diffusionsspannung abz\xfcglich der Spannung Upn."]),t.s)
B.yb=new A.cd("Dieses Applet veranschaulicht die Funktionsweise der Diode, indem eine Spannung Upn von au\xdfen an einen pn-\xdcbergang gelegt wird. Nach Vorgabe der Spannung Upn wird der Strom I durch die Diode berechnet. Dar\xfcber hinaus werden die Verteilungen der Ladungstr\xe4ger (Elektronen und L\xf6cher) im p- und n-Gebiet sowie das elektrische Feld E bestimmt und grafisch dargestellt.\n\nMan sieht:\n",B.G5,null)
B.Fu=A.a(s(["Ist im Valenzband eine L\xfccke (auch Defektelektron oder Loch genannt) entstanden, so k\xf6nnen benachbarte Elektronen in diese L\xfccke springen (obere Grafik), was einem Ladungstransport und damit einem Stromfluss entspricht.","Die Bewegung der nachr\xfcckenden Elektronen (hier: Bewegung negativer Ladung von rechts nach links) hat den gleichen Effekt wie eine sich in die andere Richtung (also von links nach rechts) bewegende positive Ladung (untere Grafik).","Ein fehlendes Elektron, d.h. allgemein ein Zustand, der nicht von einem Elektron besetzt ist, kann daher als ein eigenes Teilchen mit positiver Ladung, ein so genanntes Loch, betrachtet werden.","Neben der Anzahl der freien Elektronen im Leitungsband ist daher auch die Anzahl der freien L\xf6cher im Valenzband wesentlich f\xfcr die elektrischen Eigenschaften des Halbleiters verantwortlich, da beide Ladungstr\xe4gerarten zum Stromtransport beitragen k\xf6nnen."]),t.s)
B.yc=new A.cd('Bricht durch Zufuhr von Energie eine Bindung im undotierten Halbleiter auf, d.h. gelangt im B\xe4nderdiagramm ein Elektron vom Valenzband in das Leitungsband, so kann es sich frei bewegen und zum Ladungstransport beitragen. Doch auch die entstandene "L\xfccke" (das Loch) kann zum Ladungstransport beitragen, indem in diese L\xfccke ein anderes Elektronen nachr\xfcckt, welches daraufhin an einer anderen Stelle ein Loch hinterl\xe4sst. Das Loch "wandert" also gleichsam durch den Halbleiter. Das folgende Applet zeigt die zwei m\xf6glichen Betrachtungsweisen des Ladungstransports im Valenzband. Die obere Abbildung zeigt die Bewegung der Elektronen (Elektronenkonzept), die untere stellt den Vorgang durch die Bewegung der "L\xfccke" dar (L\xf6cherkonzept).\n\nMan sieht:\n',B.Fu,null)
B.Fv=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.s)
B.yd=new A.cd("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\nMan sieht:\n",B.Fv,null)
B.Ha=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.","Soll eine sinusf\xf6rmige Basis-Emitter-Spannung (AC on) verst\xe4rkt werden, so ergibt sich die beste Verst\xe4rkerwirkung, wenn das Signal um eine Spannung UBE0 herum ge\xe4ndert wird, die in etwa in der Mitte des aussteuerbaren Bereiches, d.h. UBE0=0.72V, liegt.","Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.s)
B.ye=new A.cd(u.f,B.Ha,null)
B.FL=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.s)
B.yf=new A.cd("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.FL,null)
B.EE=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.s)
B.yg=new A.cd("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.EE,null)
B.Fm=A.a(s(["Bei undotierten Halbleitern liegt das Ferminiveau etwa in der Mitte des verbotenen Bandes.","Dotiert man den Halbleiter mit Donatoren (Erh\xf6hung von ND), so wandert der Schnittpunkt der beiden Kurven zur Leitungsbandkante Wc. Bei einer Dotierung mit Akzeptoren wandert das Ferminiveau entsprechend zur Valenzbandkante Wv.","Wird der Halbleiter sowohl mit Donatoren als auch mit Akzeptoren dotiert, so wird das Verhalten des Halbleiters (n- oder p-Typ) allein durch die Dotieratome mit der h\xf6heren Konzentration bestimmt.","Da f\xfcr einen undotierten Halbleiter die Tr\xe4gerdichten n0 und p0 gleich der Eigenleitungstr\xe4gerdichte ni sind und das Ferminiveau WF gleich dem Eigenleitungsniveau Wi ist, folgen unmittelbar die wichtigen Beziehungen:"]),t.s)
B.yh=new A.Eu(null)
B.GP=A.a(s(["Liegt das Ferminiveau in der Mitte zwischen Valenz- und Leitungsbandkante (undotierter Halbleiter), so sind die Kurven nw und pw symmetrisch zu Wf. Insbesondere sind die Fl\xe4chen unter den beiden Kurven und damit die Anzahl der freien Ladungstr\xe4ger n0 und p0 gleich gro\xdf.","Eine Erh\xf6hung der Temperatur f\xfchrt wegen des sich \xe4ndernden Verlaufes der Fermiverteilung zu einer Erh\xf6hung beider Tr\xe4gerdichten.","Bei einem n-dotierten Halbleiter, bei dem das Ferminiveau Wf und damit die gesamte Kurve F(W) nach oben verschoben ist, ergibt die Multiplikation und anschlie\xdfende Integration der Kurven einen h\xf6heren Wert f\xfcr die Elektronendichte n0 und einen kleineren Wert f\xfcr die L\xf6cherdichte p0. Umgekehrtes gilt f\xfcr einem p-Typ Halbleiter. Die Lage des Ferminiveaus Wf bestimmt also unmittelbar die Tr\xe4gerdichten im thermodynamischen Gleichgewicht."]),t.s)
B.yi=new A.Ev(null)
B.Fj=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.s)
B.yj=new A.cd("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Fj,null)
B.G_=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.s)
B.yk=new A.cd("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE.\n\nMan sieht:\n",B.G_,null)
B.cC=A.a(s([]),t.s)
B.yl=new A.cd("Dieses Applet zeigt den stark vereinfachten Ablauf eines CMOS-Prozesses zur Herstellung integrierter Schaltungen. Im Gegensatz zum NMOS Prozess erlaubt der CMOS-Prozess die gleichzeitige Herstellung von n- und p-Kanal Feldeffekttransistoren auf einem Chip.\n",B.cC,null)
B.EB=A.a(s(["Liegt ein Elektron energiem\xe4\xdfig oberhalb der Bandkante Wc, so besitzt es zus\xe4tzliche kinetische Energie und damit einen Impuls i. Die Impulsvektoren aller Teilchen mit einer Energie zwischen W und W+dW haben demnach einen Impuls zwischen i und i+di, so dass die Impulsvektoren auf einer Kugelschale mit dem Radius i und der Dicke di liegen.","Die Zahl der voneinander unterscheidbaren Impulsvektoren auf der Kugelschale ist jedoch begrenzt, da der Impuls nach der Heisenbergschen Unsch\xe4rferelation eine gewisse Unsch\xe4rfe hat, wenn der Ort des Teilchens genau bestimmt ist. Die Impulsvektoren m\xfcssen also einen bestimmten Mindestabstand voneinander haben.","Erh\xf6ht man nun die Energie W und damit den Impuls i, entspricht das einer Vergr\xf6\xdferung der Kugelschale, so dass nun mehr Impulsvektoren Platz finden; die Zustandsdichte nimmt zu."]),t.s)
B.ym=new A.cd("Dieses Applet veranschaulicht den Begriff der Zustandsdichte.\n\nMan sieht:\n",B.EB,null)
B.G7=A.a(s(["Liegt das Ferminiveau WF in der Mitte zwischen den beiden Bandkanten auf dem Intrinsicniveau Wi, so sind die Elektronendichte und die L\xf6cherdichte gleich der Intrinsicdichte ni.","Eine Verschiebung des Ferminiveaus zur Leitungsbandkante (was einem n-Typ Halbleiter entspricht) f\xfchrt zu einem Anstieg der Elektronendichte n0 und einer Abnahme der L\xf6cherdichte p0.","Bei einem p-Typ Halbleiter, bei dem das Ferminiveau zur Valenzbandkante verschoben ist, ist dagegen die L\xf6cherdichte erh\xf6ht und die Elektronendichte vermindert.","In allen F\xe4llen gilt, dass (im thermodynamischen Gleichgewicht) das Produkt aus Elektronendichte und L\xf6cherdichte gleich ni^2 ist (Massenwirkungsgesetz), was sich in der logarithmischen Darstellung deutlich zeigt."]),t.s)
B.yn=new A.Ew(null)
B.Ez=A.a(s(["Der Wert der Raumladungsdichte wird durch die Dotierung in dem entsprechenden Gebiet bestimmt, also durch ND im n-Gebiet und durch NA im p-Gebiet.","Aus Neutralit\xe4tsgr\xfcnden m\xfcssen sich die Ladungen im p- und n-Gebiet gegenseitig kompensieren, d.h. die Fl\xe4chen unter den Rechtecken m\xfcssen gleich gro\xdf sein.","Daraus folgt, dass sich die Raumladungszone um so weiter in den Halbleiter erstreckt, je geringer die Dotierung ist. Gleichzeitig wird die Raumladung und damit das elektrische Feld kleiner."]),t.s)
B.yo=new A.cd("Dieses Applet zeigt, wie sich die Raumladungszone eines pn-\xdcberganges mit den Dotierungsdichten NA und ND des p- und des n-Gebietes \xe4ndert.\n\nMan sieht:\n",B.Ez,null)
B.FR=A.a(s(["Bei negativen Spannungen zwischen Gate und Halbleitermaterial (UGB<0V) werden freie Ladungstr\xe4ger (L\xf6cher) aus dem p-dotierten Material von der negativen Elektrode angezogen, so dass eine Schicht positiver Ladung unterhalb des Gates entsteht. Auf dem Gate bildet sich eine entsprechende Gegenladung. Den sich einstellenden Zustand nennt man Akkumulation.","Bei einer positiven Spannung am Gate (UGB>0V) wandern die freien L\xf6cher von der positiven Elektrode weg. In dem ausger\xe4umten Gebiet verbleiben nur die (nicht gezeichneten) negativ ionisierten Dotierungsatome und es entsteht eine Raumladungszone. Diesen Zustand bezeichnet man als Verarmung.","Wird die Spannung am Gate weiter erh\xf6ht, so dass schlie\xdflich die Einsatzspannung \xfcberschritten wird (UGB>Uth,n), werden Elektronen-Loch Paare generiert, wobei die positiven L\xf6cher in das Substrat wandern, die negativen Elektronen jedoch von der positiven Elektrode angezogen werden, wo sie eine leitende Inversionsschicht bilden. Bei einem n-Kanal Feldeffekttransistor mit n-dotierten Source- und Drain-Anschl\xfcssen stellt dieser Elektronen-Kanal eine leitende Verbindung zwischen Source und Drain dar: Ein Feldeffekttransistor leitet also, wenn die Gate-Source Spannung die Einsatzspannung \xfcberschreitet."]),t.s)
B.yp=new A.cd("Das folgende Applet zeigt das Verhalten einer MOS-Struktur beim Anlegen unterschiedlicher Spannungen. Eine MOS-Struktur besteht aus einem Halbleiter (hier p-Typ) mit einer isolierenden Oxidschicht, auf der eine Metallelektrode aufgebracht ist. Zwischen der Metallelektrode (G) und dem Halbleiter (B) kann eine Spannung angelegt werden. Nach Vorgabe der Spannung werden die freien Ladungstr\xe4ger innerhalb der Struktur und die Ladungsdichten dargestellt.\n\nMan sieht:\n",B.FR,null)
B.H_=A.a(s(["F\xfcr T=0 nehmen die Elektronen ihren jeweils niedrigstm\xf6glichen Energiezustand an. Da nach dem Pauli-Prinzip ein Zustand jedoch nur mit maximal zwei Elektronen besetzt werden kann, sind auch von Null verschiedene Zust\xe4nde mit Elektronen besetzt. Die Energie, bis zu der bei T=0 alle Zust\xe4nde besetzt sind, bezeichnet man als das Ferminiveau Wf.","Die Besetzungswahrscheinlichkeit F(W) ist bei T=0 daher F(W)=1 f\xfcr alle Energieniveaus unterhalb des Ferminiveaus und F(W)=0 f\xfcr alle Energieniveaus oberhalb des Ferminiveaus.","Eine Erh\xf6hung der Temperatur T f\xfchrt zu einer Zunahme der Gesamtenergie in dem System. Dies \xe4u\xdfert sich darin, dass einzelne Elektronen auch h\xf6here Energiezust\xe4nde annehmen k\xf6nnen. Die Besetzungswahrscheinlichkeit F(W) h\xf6herer Zust\xe4nde nimmt daher zu und die niedriger Zust\xe4nde entsprechend ab.","Je h\xf6her die Temperatur ist, um so h\xf6her ist die Gesamtenergie des Systems. Die Wahrscheinlichkeit, dass ein energetisch hochliegender Zustand besetzt ist, steigt demnach mit zunehmender Temperatur immer weiter an. Gleichzeitig nimmt die Wahrscheinlichkeit, dass energetisch tiefliegende Zust\xe4nde besetzt sind, ab."]),t.s)
B.yq=new A.cd("Dieses Applet veranschaulicht die Bedeutung der Fermiverteilung F(W) und des Ferminiveaus anhand eines Systems mit diskreten Energiezust\xe4nden.\n\nMan sieht:\n",B.H_,null)
B.FN=A.a(s(["Abh\xe4ngig von der Lage des Ferminiveaus handelt es sich um einen p- oder n-Typ Halbleiter mit entsprechender Konzentration der Ladungstr\xe4gerdichten (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus).","Bei einer Spannung von U=0V liegt das Ferminiveau \xfcberall auf gleicher H\xf6he, der Halbleiter ist im thermodynamischen Gleichgewicht und es flie\xdft kein Strom durch den Halbleiter.","Das Anlegen einer elektrischen Spannung an den Halbleiter bewirkt eine Verschiebung der Bandkanten gem\xe4\xdf U=-W/q, so dass das Ferminiveau innerhalb des Halbleiters nicht mehr auf energetisch gleicher H\xf6he liegt, was einer St\xf6rung des thermodynamischen Gleichgewichts entspricht.",'Elektronen und L\xf6cher bewegen sich aufgrund ihrer Ladung und der Richtung des elektrischen Feldes zu den entsprechenden Polen der Spannungsquelle. In der B\xe4nderdiagrammdarstellung haben Elektronen stets das Bestreben, "nach unten" zu flie\xdfen, da dies einer Abnahme ihrer Energie entspricht; L\xf6cher streben entsprechend "nach oben". Bei geneigten Bandkanten stellt sich somit ein Ladungstr\xe4gertransport und damit ein Stromfluss I ein.',"Abh\xe4ngig von der Art und St\xe4rke der Dotierung (d.h. der Lage des Ferminiveaus relativ zu Wi) wird der Strom eher von Elektronen (n-Typ Halbleiter) oder von L\xf6chern (p-Typ Halbleiter) getragen."]),t.s)
B.yr=new A.cd("Das folgende Applet zeigt den Vorgang des Ladungstr\xe4gertransportes in einem Halbleiter mit Hilfe der B\xe4nderdiagrammdarstellung, abh\xe4ngig von der angelegten Spannung und der Lage des Ferminiveaus.\n\nMan sieht:\n",B.FN,null)
